import EmotionAnalyzer from "./component/EmotionAnalyzer";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import React from "react";

function App() {
  return (
      <Router>
          <Routes>
              <Route path="/" element={<EmotionAnalyzer/>} />
          </Routes>
      </Router>

  );
}

export default App;
